window.bookSummaryJSON = "<p><b><i>This is insane. This human—beautiful though she may be—can’t be my mate.</i></b></p> <p>I learned the hard way what it's like to lose people you love.</p> <p>As an alpha, I vowed never to let that happen again.</p> <p>That means keeping my focus. Never letting my guard down.</p> <p>And, most of all, staying away from civilians—i.e. humans.</p> <p>But the feisty chocolatier has me breaking my own rules.</p> <p>The beautiful female tests my patience...and all my control.</p> <p>I should stay away. I can't protect the pack if I succumb to my desires.</p> <p>But what if this is more than desire?</p> <p>What if Fate matched me with this human, and <b>she's my mate</b>?</p> <p>If I don't claim her, I'll lose it all in the worst possible way.</p>"; 
